import React, { Component } from "react";
class Head extends Component {
  state = {
    logo: "img/firefox_logo-only_RGB120px.png"
  };
  imageHandle() {
    <img src={this.logo} alt="Rand pic" />;
  }
  render() {
    return (
      <div>
        <img></img>
      </div>
    );
  }
}

export default Head;
